import styled from 'styled-components'
export const HeaderLink = styled.div`
    display: flex;
    align-items: center;
    justify-content: center;
    margin: 0 auto;
`;

export const Link = styled.a`
    color: white;
    font-weight: bold;
    text-decoration: none;
    text-align: center;
`;
